svg.script:
document.addEventListener('DOMContentLoaded', function() {
  // Sélectionner toutes les zones interactives
  var areas = document.querySelectorAll('path[id^="area"], rect[id^="area"]');

  // Ajouter un gestionnaire de clic à chaque zone
  areas.forEach(function(area) {
    area.addEventListener('click', function(event) {
      event.stopPropagation(); // Empêcher la propagation du clic

      // Désélectionner toutes les zones
      areas.forEach(function(a) {
        a.classList.remove('selected');
      });

      // Sélectionner la zone cliquée
      this.classList.add('selected');
    });
  });

  // Ajouter un gestionnaire de clic sur le fond pour désélectionner
  document.querySelector('svg').addEventListener('click', function() {
    // Désélectionner toutes les zones
    areas.forEach(function(area) {
      area.classList.remove('selected');
    });
  });
});
